import styled from "styled-components";

const Nav = () => {
  const Nav = styled.nav`
    .navbar-lists {
      display: flex;
      gap: 4.8rem;
      align-item: center;

      .navbar-link {
        &:link,
        &:visited {
          display: inline-block;
          text-decoration: none;
          font-size: 1.8rem;
          font-weight: 500;
          text-transform: uppercase;
        }
      }
    }
  `;
  return (
    <Nav>
      <div className=""></div>
    </Nav>
  );
};

export default Nav;
